    return (
        <div className='title'>
            <h1>Our Tours</h1>
            <div className='underline'></div>
            <h3>5 birthdays today</h3>
            {data.map((val, index) => {
                return <Tour data={val} key={index} />
            })}
            {/* <Tour />
